import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';

const App = () => {
    return (
        <div className="ui container comments">
            <CommentDetail author="Sam" timeAgo="Today at 4:45PM" commentText="Nice blog post!" avatarImage={faker.image.avatar()} />
            <CommentDetail author="Alex" timeAgo="Today at 2:45PM" commentText="Great!!" avatarImage={faker.image.avatar()} />
            <CommentDetail author="Jane" timeAgo="Yesterday at 4:40PM" commentText="Helloooooo!" avatarImage={faker.image.avatar()} />
        </div>
    );
};

ReactDOM.render(
    <App />,
    document.querySelector('#root')
);
